export default {
  id: "bpmn-symbols-game",
  pluginPoint: "cockpit.dashboard",
  priority: 5,
  render: container => {
      container.innerHTML = `<button>ğŸ¤¸</button>
      <canvas width="520" height="400"></canvas>
      <div style="display:none;">
          <img id="ball" src="data:image/jpeg;base64," />
          <img id="object1" src="data:image/jpeg;base64," />
          <img id="object2" src="data:image/jpeg;base64," />
          <img id="object3" src="data:image/jpeg;base64," />
    <img id="object4" src=" data:image/jpeg;base64," />
  </div>
      <p>Click the button to start. Play with Key-Left, Key-Right and Key-Up`;

      container.querySelector("button").addEventListener("click", () => {
          start();
      });

      var context = container.querySelector("canvas").getContext("2d");

      // init background
      context.fillStyle = "#000000";
      context.fillRect(0, 0, 520, 400);

      class Rectangle {

          constructor(x, y, w, h) {
              this.x = x; this.y = y; this.w = w; this.h = h;

          }
          get cx() { return this.x + this.w * 0.5; }
          get cy() { return this.y + this.h * 0.5; }

          collideRectangle(rect) {
              var dx = rect.cx - this.cx;// x difference between centers
              var dy = rect.cy - this.cy;// y difference between centers
              var aw = (rect.w + this.w) * 0.5;// average width
              var ah = (rect.h + this.h) * 0.5;// average height
              /* If either distance is greater than the average dimension there is no collision. */
              if (Math.abs(dx) > aw || Math.abs(dy) > ah) return false;

              return true;
          }

      }

      function getRandomInt(max) {
          return Math.floor(Math.random() * max);
      }

      var ball = {
          jumping: false,
          x_velocity: 0,
          y_velocity: 0,
          rectangle: new Rectangle(10, 0, 32, 32)
      };

      var hurdle = {
          counter: 0,
          speed: 1,
          changeImage: false,
          image: "object1",
          rectangle: new Rectangle(450, 320, 80, 65)
      };

      var controller = {
          left: false,
          right: false,
          up: false,
          keyListener: function (event) {
              var key_state = (event.type == "keydown") ? true : false;
              switch (event.keyCode) {
                  case 37:// left key
                      controller.left = key_state;
                      break;
                  case 38:// up key
                      controller.up = key_state;
                      break;
                  case 39:// right key
                      controller.right = key_state;
                      break;
              }
          }
      };

      function drawScore() {
          context.font = "16px Arial";
          context.fillStyle = "#0095DD";
          context.fillText("Score: " + hurdle.counter, 8, 20);
      }

      function loop() {
          var lose = false;

          if (controller.up && ball.jumping == false) {
              ball.y_velocity -= 50;
              ball.jumping = true;
          }
          if (controller.left) {
              ball.x_velocity -= 0.5;
          }

          if (controller.right) {
              ball.x_velocity += 0.5;
          }

          ball.y_velocity += 1.5;// gravity
          ball.rectangle.x += ball.x_velocity;
          ball.rectangle.y += ball.y_velocity;
          ball.x_velocity *= 0.9;// friction
          ball.y_velocity *= 0.9;// friction

          // if rectangle is falling below floor line
          var baseLine = 400 - 16 - 32;
          if (ball.rectangle.y > baseLine) {
              ball.jumping = false;
              ball.rectangle.y = baseLine;
              ball.y_velocity = 0;
          }

          // if rectangle is going off the left of the screen
          if (ball.rectangle.x < -32) {
              ball.rectangle.x = 0;
          } else if (ball.rectangle.x > 520) { // if rectangle goes past right boundary
              ball.rectangle.x = 460;
          }

          context.fillStyle = "#000000";
          context.fillRect(0, 0, 520, 400);

          context.strokeStyle = "#202830";
          context.lineWidth = 4;
          context.beginPath();
          context.moveTo(0, 380);
          context.lineTo(520, 380);
          context.stroke();

          var imgBall = document.getElementById("ball");
          context.drawImage(imgBall, ball.rectangle.x, ball.rectangle.y);

          if (ball.rectangle.collideRectangle(hurdle.rectangle)) {
              lose = true;
          }

          if (ball.rectangle.x > hurdle.rectangle.x + 90 && ball.rectangle.y == baseLine) {
              hurdle.counter += 1;
              hurdle.rectangle.x = 600;
              hurdle.changeImage = true;
          } else {
              if (hurdle.changeImage) {
                  var random = getRandomInt(4);
                  switch (random) {
                      case 0:
                          hurdle.image = "object1";
                          break;
                      case 1:
                          hurdle.image = "object2";
                          break;
                      case 2:
                          hurdle.image = "object3";
                          break;
                      case 3:
                          hurdle.image = "object4";
                          break;
                  }
              }
              var imgObject = document.getElementById(hurdle.image);
              context.drawImage(imgObject, hurdle.rectangle.x, hurdle.rectangle.y);
              hurdle.changeImage = false;
          }

          hurdle.rectangle.x -= hurdle.speed;
          hurdle.speed += 0.001;

          if (lose) {
              alert('You lose! Your score:' + hurdle.counter);
              location.reload();
          }

          drawScore();
          // call update when the browser is ready to draw again
          window.requestAnimationFrame(loop);
      }

      function start() {
          window.requestAnimationFrame(loop);
      }

      window.addEventListener("keydown", controller.keyListener)
      window.addEventListener("keyup", controller.keyListener);
  }
};

